message:
A especialista em toxicologia Dra. Janci Linsday fala em um painel de discussão organizado pelo senador Ron Johnson sobre o tópico de terapias genéticas de “vírus” em Washington D.C.

 Esses alertas sobre danos reprodutivos e possíveis danos às gerações futuras foram ocultados na grande mídia e no noticiário internacional e removidos das redes sociais por serem considerados, sem qualquer motivação, "desinformação".
@GeFazioBreakingNews 🇺🇸🇧🇷

Este é o nível dos hologramas atualmente. A hora que iniciarem o projeto Blue Beam, a humanidade irá aceitar sem pestanejar.

